    @staticmethod
    def add_result(week,results,rank=None,projected_rank=None,player_name=None,wins=None,losses=None,win_pct=None,projected_wins=None,possible_wins=None,winner=None):
        player_id = TestData.get_player_id(week,player_name)
        result = WeekResults()
        result.rank = rank
        result.projected_rank = projected_rank
        result.player_id = player_id
        result.player_name = player_name
        result.wins = wins
        result.losses = losses
        result.win_pct = "%0.3f" % (win_pct)
        result.projected_wins = projected_wins
        result.possible_wins = possible_wins

        result.winner = None
        if winner != None:
            result.winner = week.get_player_key(winner)
        else:
            result.winner = None
        results.append(result)

    @staticmethod
    def get_player_id(week,player_name):
        player_key = week.get_player_key(player_name)
        player = week.get_player(player_key)
        return player.key().id()

